import "./chart.css";
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


export default function Chart(){
    const data = [
        {
          name: 'Jan',
          "Active User": 4000,
          
        },
        {
          name: 'Feb',
          "Active User": 3000,
           
        },
        {
          name: 'March',
          "Active User": 2000,
         
        },
        {
          name: 'April',
          "Active User": 2780,
        
        },
        {
          name: 'May',
          "Active User": 1890,
          
        },
        {
          name: 'June',
          "Active User": 2390,
         
        },
        {
          name: 'July',
          "Active User": 3490,
       
        },
        {
            name: 'August',
            "Active User": 2000,
         
        },
        {
            name: 'Sept',
            "Active User": 2500,
         
        },
        {
            name: 'Oct',
            "Active User": 2800,
         
        },
        {
            name: 'Nov',
            "Active User": 2200,
         
        },
        {
            name: 'Dec',
            "Active User": 3490,
         
        },


      ];
    return(
        
        <div className="chart">
            <h3 className="chartTitle">Sales Analytics</h3>
            <ResponsiveContainer width = "100%" aspect={4/1}>
              <LineChart data={data}>
                  <XAxis dataKey="name" stroke="#c629fb"/>
                  <Line type="monotone" dataKey="Active User" stroke="#c629fb" />
                  <Tooltip/>
                  <CartesianGrid stroke="#e0dfdf" strokeDasharray/>
              </LineChart>  
            </ResponsiveContainer>
        </div>
    )
}
